        "pkg-path": "tempo"
      }
    },
    "vars": {
      "BETRACE_COVERAGE_BRANCH_MIN": "80",
      "BETRACE_COVERAGE_INSTRUCTION_MIN": "90",
      "BETRACE_PORT_BACKEND": "12011",
      "BETRACE_PORT_CADDY": "3000",
      "BETRACE_PORT_FRONTEND": "12010",
      "BETRACE_PORT_GRAFANA": "12015",
      "BETRACE_PORT_LOKI": "3100",
      "BETRACE_PORT_LOKI_GRPC": "9096",
      "BETRACE_PORT_MCP_SERVER": "12016",
      "BETRACE_PORT_OTEL_GRPC": "4317",
      "BETRACE_PORT_OTEL_HTTP": "4318",
      "BETRACE_PORT_PROCESS_UI": "12013",
      "BETRACE_PORT_PROMETHEUS": "9090",
      "BETRACE_PORT_PYROSCOPE": "3210",
      "BETRACE_PORT_PYROSCOPE_GRPC": "9105",
      "BETRACE_PORT_TEMPO": "3200",
      "BETRACE_PORT_TEMPO_GRPC": "9097",
      "CGO_ENABLED": "1",
      "GOFLAGS": "-mod=vendor"
    },
    "hook": {
      "on-activate": "  echo \"🎯 BeTrace Development Environment\"\n  echo \"==================================\"\n  echo \"\"\n  echo \"📁 Applications:\"\n  echo \"  bff/         - React Frontend (Tanstack ecosystem)\"\n  echo \"  backend-go/  - Go Backend (DuckDB + OTEL)\"\n  echo \"\"\n  echo \"🚀 Start Observability Stack:\"\n  echo \"  flox services start\"\n  echo \"  # Services: Loki, Tempo, Prometheus, Pyroscope, Alloy, Grafana\"\n  echo \"  # Access Grafana: http://localhost:12015 (admin/admin)\"\n  echo \"  # All configs generated from Nix expressions\"\n  echo \"\"\n  echo \"🔨 Development:\"\n  echo \"  cd bff && npm run dev              - Frontend dev server\"\n  echo \"  cd backend-go && go run ./cmd/betrace-backend - Backend dev\"\n  echo \"\"\n  echo \"🧪 Testing:\"\n  echo \"  test-runner     - Run all tests\"\n  echo \"  test-watch      - Continuous testing\"\n  echo \"  serve-coverage  - View coverage reports\"\n  echo \"\"\n  echo \"💡 Tip: Keep this shell open to keep services running!\"\n  echo \"\"\n"
    },
    "profile": {},
    "options": {
      "systems": [
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin",
        "x86_64-linux"
      ]
    },
    "services": {
      "alloy": {
        "command": "cd $FLOX_ENV_PROJECT && exec nix run ./.flox/pkgs#alloy-wrapped"
      },
      "backend": {
        "command": "  cd $FLOX_ENV_PROJECT/backend && export CGO_ENABLED=1 && export GOFLAGS=\"-mod=vendor\" && echo \"🚀 Starting BeTrace backend in watch mode...\" && go run ./cmd/betrace-backend &\n  BACKEND_PID=$! && fswatch -o -r --event Updated ./cmd ./internal ./pkg -e '.*\\.swp$' -e '.*~$' -e '.*/\\..*' | while read -r num; do\n    echo \"🔄 File changed, restarting backend...\" && kill $BACKEND_PID 2>/dev/null || true && sleep 1 && go run ./cmd/betrace-backend &\n    BACKEND_PID=$!\n  done\n"
      },
      "grafana": {
        "command": "cd $FLOX_ENV_PROJECT && exec nix run ./.flox/pkgs#grafana-wrapped"
      },
      "loki": {
        "command": "cd $FLOX_ENV_PROJECT && exec nix run ./.flox/pkgs#loki-wrapped"
      },
      "prometheus": {
        "command": "cd $FLOX_ENV_PROJECT && exec nix run ./.flox/pkgs#prometheus-wrapped"
      },
      "pyroscope": {
        "command": "cd $FLOX_ENV_PROJECT && exec nix run ./.flox/pkgs#pyroscope-wrapped"
      },
      "tempo": {
        "command": "cd $FLOX_ENV_PROJECT && exec nix run ./.flox/pkgs#tempo-wrapped"
      }
    }
